import { Route } from 'react-router-dom';

export default function PrivateRoute({ component: Component, ...rest }) {
    return (
        <Route
            {...rest}
            render={props =>
                props.isLoggedIn ? ( <Component {...props} /> ) : ( <Redirect to={{ pathname: '/login', state: {from: props.location} }} /> )
            }
        />
    );
}
